static int casadi_f11(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  int flag;
  struct casadi_qp_data d;
  struct casadi_qp_prob p;
  p.sp_a = casadi_s159;
  p.sp_h = casadi_s169;
  p.sp_at = casadi_s160;
  p.sp_kkt = casadi_s175;
  p.sp_v = casadi_s176;
  p.sp_r = casadi_s177;
  p.prinv = casadi_s178;
  p.pc =  casadi_s179;
  casadi_qp_setup(&p);
  p.max_iter = 1000;
  p.min_lam = 0;
  p.constr_viol_tol = 1e-08;
  p.dual_inf_tol = 1e-08;
  d.prob = &p;
  d.nz_h = arg[0];
  d.g = arg[1];
  d.nz_a = arg[2];
  casadi_qp_init(&d, &iw, &w);
  /* Pass bounds on z */
  if (arg[5]) {
    casadi_copy(arg[5], 490, d.lbz);
  } else {
    casadi_fill(d.lbz, 490, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 859, d.lbz+490);
  } else {
    casadi_fill(d.lbz+490, 859, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 490, d.ubz);
  } else {
    casadi_fill(d.ubz, 490, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 859, d.ubz+490);
  } else {
    casadi_fill(d.ubz+490, 859, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 490, d.z);
  } else {
    casadi_clear(d.z, 490);
  }
  casadi_fill(d.z+490, 859, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 490, d.lam);
  } else {
    casadi_clear(d.lam, 490);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 859, d.lam+490);
  } else {
    casadi_clear(d.lam+490, 859);
  }
  /* Solve QP */
  if (casadi_qp_reset(&d)) return 1;
  while (1) {
    flag = casadi_qp_prepare(&d);
    if (flag || casadi_qp_iterate(&d)) break;
  }
  /* Get solution */
  if (res[1]) casadi_copy(&d.f, 1, res[1]);
  if (res[0]) casadi_copy(d.z, 490, res[0]);
  if (res[3]) casadi_copy(d.lam, 490, res[3]);
  if (res[2]) casadi_copy(d.lam+490, 859, res[2]);
  return d.status != QP_SUCCESS;
  return 0;
}

